import { redirect } from 'react-router-dom';
export async function loader() {
  fetch('http://localhost:8080/products')
    .then((response) => {
      return response.json();
    })
    .then((resData) => {
      console.log(resData);
    })
    .catch((err) => {
      console.log(err);
    });
}
